🔮UN DIOS NUEVO🔮

Vean el arte de tapa precioso con foto se @juliasbriller intervenida por @maruts_ballet y animada por @o0o00oooooo y convertido en libro oracular por @proyectopiranha 

Todas las canciones compuestas por La Piba Berreta. Interpretadas y  arregladas junto a La Orquesta Disfuncional durante el año 2022. 
La Orquesta Disfuncional son: 
Marté @o0o00oooooo : Sintetizadores y coros
Ivan Klomp @ivan_kiiii Batería y ritmos
Lulú Problemas @luluproblemas : Guitarra y coros
Momo Zamana @momo.zamana : Bajo
K4 @k4gothetaste : Guitarras
La Piba Berreta: Vox y sintetizados
Daniel Bruno @brunodeapellido : Trombón

Invitadxs de lujo:
@4n_yi : Voces en “Mágica intuición” 
@sara_hebe : voces en “Hay que creer en algo”
@oddynasty : voces en “Búscalo”
@carton.pintado : voces en “Para Quien”
@espejo.rayado : coros en “Para Quien”
@maga.clavijo : Violines en “Un Dios Nuevo”, “Colchón”, “Búscalo” y “Corazón aeropuerto” 
@dante_klomp : Bajo en “Mejor Persona”
@genosidra : Bajo en “Hay que creer en algo”
@cortafierros : Bajo en “Navidad”
@delfinapeydro : Guitarras en “Navidad”

Grabado en @lasgraciasaudioestudio por @jmpdcsr 
Produccion @k4gothetaste @jmpdcsr @lapibaberreta 
Edición @k4gothetaste 
